import React from 'react';
import { FaChevronCircleUp, FaChevronCircleDown } from 'react-icons/fa';

import './Style.css';


function NavigationChevrons() {
  return (
      <ul className="navigation" id="nav_chevrons">
        <li><FaChevronCircleUp size={32} color={"#2c4269"} /></li>
        <li><FaChevronCircleDown size={32} color={"#2c4269"} /></li>
      </ul>
    );
}

export default NavigationChevrons;
